import React from 'react'
import Home from './Pages/Home';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import DetailUlke from './Pages/DetailUlke';


 function App() {
  return (
  <>
<BrowserRouter>
<Routes>
  <Route path='/' element={<Home/>}/>
  <Route path='/DetailUlke' element={<DetailUlke/>} />
</Routes>
</BrowserRouter>

  </>
  )
}

export default App;
